const config = {
    dev: {
        server: {
            host: 'http://localhost:5000'
        },
        fact_api : 'https://factchecktools.googleapis.com/v1alpha1/claims:search'
    },
    prod:{
        server:{
            host: ''
        },
        fact_api : 'https://factchecktools.googleapis.com/v1alpha1/claims:search'
    }
};

module.exports = (process.env.REACT_APP_ENV ? config[process.env.REACT_APP_ENV] : config["prod"]);
